import React, { useState, useEffect } from "react";
import styled, { css } from "styled-components";
import { Device } from "components/globalStyle";
import { Button } from "components/components";
import { AppBar, Left, Fab, Right } from "components/appBar";

type StateProps = {
    readonly state?: string;
};

const Main = styled.main<StateProps>`
    position: absolute;
    top: 0;
    width: 100%;
    max-height: 100%;
    grid-column-start: 2;
    display: grid;
    overflow-y: auto;

    ${(props) =>
        props.state === "entered"
            ? css`
                  visibility: visible;
                  opacity: 1;
                  transform: scale(1);
                  transition: 0.3s ease-out;
              `
            : props.state === "entering"
            ? css`
                  visibility: hidden;
                  opacity: 0;
                  transform: scale(0.9);
                  transition: 0.3s ease-in;
              `
            : css`
                  visibility: hidden;
                  opacity: 0;
                  transition: 0.15s ease-in;
              `};
`;

const Turnos = function ({ menuOpen, setMenuOpen, state }) {
    const [sideOpen, setSideOpen] = useState(false);
    const [newOpen, setNewOpen] = useState(false);

    useEffect(() => {}, []);

    return (
        <>
            <Main state={state}></Main>
            <AppBar>
                <Left>
                    <Button
                        icon
                        type="button"
                        onClick={() => {
                            setMenuOpen(!menuOpen);
                        }}
                    >
                        <i className="material-icons md-24">menu</i>
                    </Button>
                </Left>
                <Fab
                    type="submit"
                    onClick={() => {
                        setNewOpen(!newOpen);
                    }}
                    state={state}
                >
                    Encuentranos
                </Fab>
                <Right>
                    {sideOpen ? (
                        <Button
                            icon
                            type="button"
                            onClick={() => {
                                setSideOpen(!sideOpen);
                            }}
                        >
                            <i className="material-icons md-24">
                                calendar_view_day
                            </i>
                        </Button>
                    ) : (
                        <Button
                            icon
                            type="button"
                            onClick={() => {
                                setSideOpen(!sideOpen);
                            }}
                        >
                            <i className="material-icons md-24">history</i>
                        </Button>
                    )}
                </Right>
            </AppBar>
        </>
    );
};

export default Turnos;
